START TRANSACTION;

CREATE SCHEMA retaildata2;
USE retaildata2;
CREATE TABLE brands (
	product_id VARCHAR(50) NOT NULL,
	brand VARCHAR(50) NULL
, modified_brand VARCHAR(50) NULL);


CREATE TABLE finance (
	product_id VARCHAR(50),
	listing_price REAL NULL, sale_price REAL NULL, discount REAL NULL, revenue REAL NULL, modified_listing_price REAL NULL, modified_sale_price REAL NULL, modified_discount REAL NULL, modified_revenue REAL NULL);

CREATE TABLE info (
	product_name VARCHAR(512) NULL,
	product_id VARCHAR(50) NOT NULL,
	description VARCHAR(1000) NULL
, modified_product_name VARCHAR (512) NULL, modified_description VARCHAR (1000) NULL);

CREATE TABLE reviews (
	product_id VARCHAR(50) NOT NULL,
	rating VARCHAR(50) NULL,
	reviews VARCHAR(50) NULL,
	Hour REAL NULL,
	minute REAL NULL,
	real_rating VARCHAR(50),
	real_reviews REAL NULL,
	Unnamed VARCHAR(50) NULL
);

SET SQL_SAFE_UPDATES = 0;
UPDATE reviews
SET real_rating = REPLACE(real_rating, ',', '.')
WHERE real_rating LIKE '%,%';
SET SQL_SAFE_UPDATES = 1;


CREATE TABLE traffic (
	product_id VARCHAR(50) NOT NULL,
	last_visited TEXT(50) NULL
, modified_last_visited TEXT NULL);
CREATE UNIQUE INDEX info_product_id_IDX ON info (product_id);
CREATE UNIQUE INDEX finance_product_id_IDX ON finance (product_id);
COMMIT;
